// Filename - Main.jsx
import React from "react";
import Navbar from "./Navbar"
import { Link } from "react-router-dom";

export default function Main(props) {

	function handleOver(id) {
		document.getElementById(id).style.scale = 1.2
	}
	function handleLeave(id) {
		document.getElementById(id).style.scale = 1
	}

	// function makeElementsFloat(selector) {
	// 	const elements = document.querySelectorAll(selector);
	// 	elements.forEach(element => {
	// 	  element.style.animation = 'float 3s infinite ease-in-out';
	// 	});
	//   }

    const objElements = props.objects.map(object => (
		<Link to="/Details" key={object.id} >
			<button 
				id={object.id}
				className="main--button" 
				onMouseOver={()=> handleOver(object.id)}
				onMouseLeave={()=> handleLeave(object.id)}
				onClick={()=> props.selectObj(object.id)}
			>
				<img 
					src={require(`../images/${object.url}`)} 
					alt={object.label} 
					className="main--image"
				/>
			</button>
		</Link>
    ));
	document.addEventListener('DOMContentLoaded', function() {
		function getRandomInt(min, max) {
		  return Math.floor(Math.random() * (max - min + 1)) + min;
		}

		function generateRandomKeyframes(index) {
		  const x1 = getRandomInt(-10, 10);
		  const y1 = getRandomInt(-10, 10);
		  const x2 = getRandomInt(-10, 10);
		  const y2 = getRandomInt(-10, 10);

		  const keyframesName = `float-${index}`;
		  const keyframes = `
			@keyframes ${keyframesName} {
			  0% { transform: translate(0, 0); }
			  50% { transform: translate(${x1}px, ${y1}px); }
			  100% { transform: translate(${x2}px, ${y2}px); }
			}
		  `;

		  const styleSheet = document.styleSheets[0];
		  styleSheet.insertRule(keyframes, styleSheet.cssRules.length);

		  return keyframesName;
		}

		function makeElementsFloat(selector) {
		  const elements = document.querySelectorAll(selector);
		  elements.forEach((element, index) => {
			const keyframesName = generateRandomKeyframes(index);
			element.style.animation = `${keyframesName} 3s infinite ease-in-out`;
		  });
		}

		makeElementsFloat('.main--image');
	  });

	// makeElementsFloat('.main--image');

    return (
        <div className="main">
			<Navbar />
            {objElements}
        </div>
    );
}
